import { useState } from "react";
import React from "react";
import axios from "axios";
import HeaderLinks from "./HeaderLinks.js";
import Transfer from "./Transfer.js";
import DatePicker from "react-datepicker";
import "react-datepicker/dist/react-datepicker.css";

function Header() {
  return (
    <div className="header-wrapper">
      <h1>Transactions</h1>
      <HeaderLinks />
    </div>
  );
}

function Import() {
  const handleImport = (event) => {
    alert("add import");
  };

  return (
    <>
      <div id="Import" key="Import" className="is-hidden ">
        <div className="top-margin left-indent card card-body bg-light">
          <div className="Import-input-wrapper">
            <div className="import-item-wrapper">
              <label className="label">
                Date
                <DatePicker
                  className="date-picker"
                  selected={startDate}
                  onChange={(date) => setStartDate(date)}
                />
              </label>
            </div>
            <div className="import-item-wrapper">
              <label htmlFor="Import-Number" className="label">
                Amount
                <input
                  type="number"
                  id="Import-Number"
                  key="Import-Number"
                  className="form-control"
                />
              </label>
            </div>
            <div className="import-item-wrapper">
              <label htmlFor="Import-Select" className="label">
                From
                <select
                  id="Import-Select"
                  name="Import-Select"
                  key="Import-Select"
                  style={{ width: "150px" }}
                  className="form-control"
                >
                  <option value="" key="Import-Select-Blank"></option>
                  {data.map((item) => {
                    return (
                      <option value={item.id} key={item.id}>
                        {item.category}
                      </option>
                    );
                  })}
                </select>
              </label>
            </div>
            <div className="import-item-wrapper">
              <label htmlFor="Import-Select" className="label">
                To
                <select
                  id="Import-Select"
                  name="Import-Select"
                  key="Import-Select"
                  style={{ width: "150px" }}
                  className="form-control"
                >
                  <option value=""></option>
                  {data.map((item) => {
                    return (
                      <option value={item.id} key={item.id}>
                        {item.category}
                      </option>
                    );
                  })}
                </select>
              </label>
            </div>
            <div className="import-item-wrapper">
              <button
                type="submit"
                id="Import-Submit"
                key="Import-Submit"
                className="form-control"
                onClick={handleImportAdd}
              >
                add
              </button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

function Filters() {
  const handleFilters = (event) => {
    alert("add filters");
  };

  return (
    <>
      <div id="Filters" key="Filters" className="is-hidden ">
        <div className="top-margin left-indent card card-body bg-light">
          <div className="Filters-input-wrapper">
            <div className="filters-item-wrapper">
              <label className="label">
                Date
                <DatePicker
                  className="date-picker"
                  selected={startDate}
                  onChange={(date) => setStartDate(date)}
                />
              </label>
            </div>
            <div className="filters-item-wrapper">
              <label htmlFor="Filters-Number" className="label">
                Amount
                <input
                  type="number"
                  id="Filters-Number"
                  key="Filters-Number"
                  className="form-control"
                />
              </label>
            </div>
            <div className="filters-item-wrapper">
              <label htmlFor="Filters-Select" className="label">
                From
                <select
                  id="Filters-Select"
                  name="Filters-Select"
                  key="Filters-Select"
                  style={{ width: "150px" }}
                  className="form-control"
                >
                  <option value="" key="Filters-Select-Blank"></option>
                  {data.map((item) => {
                    return (
                      <option value={item.id} key={item.id}>
                        {item.category}
                      </option>
                    );
                  })}
                </select>
              </label>
            </div>
            <div className="filters-item-wrapper">
              <label htmlFor="Filters-Select" className="label">
                To
                <select
                  id="Filters-Select"
                  name="Filters-Select"
                  key="Filters-Select"
                  style={{ width: "150px" }}
                  className="form-control"
                >
                  <option value=""></option>
                  {data.map((item) => {
                    return (
                      <option value={item.id} key={item.id}>
                        {item.category}
                      </option>
                    );
                  })}
                </select>
              </label>
            </div>
            <div className="filters-item-wrapper">
              <button
                type="submit"
                id="Filters-Submit"
                key="Filters-Submit"
                className="form-control"
                onClick={handleFiltersAdd}
              >
                add
              </button>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}

function ManageWells(toToggle) {
  if (toToggle != "Import")
    document.getElementById("Import").classList.add("is-hidden");

  if (toToggle != "Filters")
    document.getElementById("Filters").classList.add("is-hidden");

  if (toToggle != "Transfer")
    document.getElementById("Transfer").classList.add("is-hidden");

  let e = document.getElementById(toToggle);
  if (e.classList.contains("is-hidden")) e.classList.remove("is-hidden");
  else e.classList.add("is-hidden");
}

function Subheader() {
  const handleImport = () => {
    ManageWells("Import");
  };
  const handleUncat = () => {
    alert("Handle uncat");
  };
  const handleDuplicates = () => {
    alert("Handle duplicates");
  };
  const handleFilters = () => {
    ManageWells("Filters");
  };
  const handleTransfer = () => {
    ManageWells("Transfer");
  };

  return (
    <div key="Subheader-Wrapper" className="subheader-wrapper">
      <div key="Subheader-Buttons" className="subheader-buttons">
        <button key="Subheader-Groups" onClick={handleImport}>
          import
        </button>
        &nbsp;&nbsp;
        <button key="Subheader-Uncatagorized" onClick={handleUncat}>
          uncatagorized
        </button>
        &nbsp;&nbsp;
        <button key="Subheader-Duplicates" onClick={handleDuplicates}>
          duplicates
        </button>
        &nbsp;&nbsp;
        <button key="Subheader-Filters" onClick={handleFilters}>
          filters
        </button>
        &nbsp;&nbsp;
        <button key="Subheader-Transfer" onClick={handleTransfer}>
          transfer
        </button>
        &nbsp;&nbsp;
      </div>
      <div key="Subheader-SubItems" className="subItems">
        <Transfer />
      </div>
    </div>
  );
}

export default function Budget() {
  return (
    <>
      <Header />
      <Subheader />
      "hello world"
    </>
  );
}
